By the triangle inequality, the sum of the distances from $P$ to $A$ and $B$ is greater than the distance from $P$ to $C$.  Therefore, the distance from $P$ to $C$ is larger than $\sqrt{10}+\sqrt{13}$.  We can find this distance by setting the distance from $P$ to $C$ equal to $x$ and solving the resulting system of equations: \begin{align*}
\sqrt{(0-x)^2+(3-0)^2} &= \sqrt{10} \\
\sqrt{(5-x)^2+(0-0)^2} &= \sqrt{13} \\
\sqrt{(x-0)^2+(0-3)^2} &= x \\
\end{align*} The first two equations represent the given information.  The third equation is the Pythagorean theorem applied to triangle $APC$.  Solving for $x$ in the third equation gives $x=3$.  Substituting this into the first equation gives $\sqrt{x^2+9}=5$.  Squaring both sides of this equation and substituting $x=3$ into the resulting equation gives $x^2+9=25$, so $x^2=16$ and $x=4$.  Therefore, the distance from $P$ to $C$ is $4+\sqrt{10}+\sqrt{13}$.  The answer is: 4+\sqrt{10}+\sqrt{13}

