The distance between the origin and $(2t + 7, 4t - 13)$ is
\[\sqrt{(2t + 7)^2 + (4t - 13)^2} = \sqrt{4t^2 + 14t + 49} = \sqrt{(2t + 7)^2} = |2t + 7|.\]Thus, the speed of the particle is
\[\frac{|2t + 7|}{t} = \boxed{2 + \frac{7}{t}} \quad \text{units per unit of time}.\] The answer is: 2 + \frac{7}{t}

We have that
\[\mathbf{A} + \mathbf{A}^{-1} = \begin{pmatrix} a & 1 \\ -2 & d \end{pmatrix} + \frac{1}{(ad - 2)^2} \begin{pmatrix} d & -1 \\ 2 & a \end{pmatrix} = \mathbf{0}.\]This gives us $a + \frac{d}{(ad - 2)^2} = 0$ and $-2 + \frac{2a}{(ad - 2)^2} = 0.$  Solving, we find $a = \frac{2}{ad - 2}$ and $d = \frac{2}{ad - 2}.$  Hence,
\[\det \mathbf{A} = ad - 2 = \frac{4}{(ad - 2)^2} - 2 = \boxed{-\frac{2}{ad - 2}}.\] The answer is: -\frac{2}{ad - 2}

