Then $AD \cdot DE = 16^2$, $BE \cdot CE = 16^2$, and $BF \cdot FG = 16^2$.  By the Law of Cosines on triangle $ABC$,
\[AC^2 = BC^2 + AB^2 - 2 \cdot BC \cdot AB \cos A = 56^2 + 100^2 - 2 \cdot 56 \cdot 100 \cos A = 3136.\]Then
\begin{align*}
AD^2 &= AC^2 - DE^2 \\
&= 3136 - 16^2 \\
&= 3072,
\end{align*}so $AD = \sqrt{3072} = 128$.

Similarly, $BE^2 = 3072$, so $BE = 128$.

Also,
\begin{align*}
BG^2 &= BF^2 - FG^2 \\
&= 16^2 - 16^2 \\
&= 0,
\end{align*}so $BG = 0$, which means $G$ lies on segment $BC$.  Let $G = g \cdot B + (1 - g) \cdot C$, where $g \in [0,1]$.

By the Law of Cosines on triangle $ABC$,
\[AB^2 = AC^2 + BC^2 - 2 \cdot AC \cdot BC \cos B = 100^2 + 56^2 - 2 \cdot 100 \cdot 56 \cos B = 676.\]Then
\begin{align*}
BG^2 &= AB^2 - BF^2 \\
&= 676 - 16^2 \\
&= 664,
\end{align*}so
\begin{align*}
g^2 (1 - g)^2 (664) &= (1 - g)^2 (128)^2 \\
&= (1 - g)^2 (64)^2 (2^2) \\
&= (1 - g)^2 (64) (2^4) \\
&= (1 - g)^2 (2^5) \\
g^2 (664) &= (2^5) \\
g^2 &= \frac{2^5}{664} \\
g &= \frac{2^2}{11}.
\end{align*}Then
\begin{align*}
QR^2 &= QG^2 - GR^2 \\
&= (128)^2 - (56 + 100 - 2 \cdot 128 \cdot \frac{2^2}{11})^2 \\
&= \frac{4 \cdot 2^4 \cdot 11^2}{11^2 - 4 \cdot 2^2} \\
&= \frac{2^4 \cdot 11^2}{11 - 2 \cdot 2} \\
&= \frac{2^4 \cdot 11^2}{9} \\
&= 2^2 \cdot 11^2 \\
&= 2500.
\end{align*}Thus, $QR = 50$.

Let $H$ be the foot of the perpendicular from $R$ to line $BC$.  Then $RH = 56 + 100 - 2 \cdot 128 \cdot \frac{2^2}{11} = 48$.  By the Pythagorean Theorem, $QH = \sqrt{50^2 - 48^2} = 24$.

Let $q$ be the radius of circle $Q$.  Then
\[q^2 = qr^2 + rh^2 - 2 \cdot qr \cdot rh \cos Q = 2500 + 24^2 - 2 \cdot 24 \cdot 56 \cos Q.\]Since $Q$ is externally tangent to $P$, $\cos Q = -\frac{15}{16}$.  Then
\begin{align*}
q^2 &= 2500 + 24^2 + 24 \cdot 56 \cdot \frac{15}{16} \\
&= 2500 + 24 \cdot 56 \cdot \frac{15}{16} \\
&= 2500 + 1440 \\
&= 3940.
\end{align*}Therefore, $q = \sqrt{3940} = 63 - 47\sqrt{5}$.  Thus, the answer is $63 + 47 = \boxed{110}$. The answer is: 110

