Note that $\frac{ab+1}{a+b} < \frac{3}{2}$ is equivalent to $ab+1 < \frac{3}{2}(a+b),$ or $ab+1 < \frac{3}{2}a + \frac{3}{2}b.$ Multiplying both sides by $-\frac{2}{3},$ we get $-\frac{2}{3}ab - \frac{2}{3} < -a - b.$ Adding $1$ to both sides, we get $-\frac{2}{3}a - \frac{2}{3}b < -1.$ Then, multiplying both sides by $-\frac{3}{2},$ we get $a + b < -\frac{3}{2}.$

Thus, $a$ and $b$ must both be less than $-\frac{3}{2}.$ Then, $a^3$ and $b^3$ are both positive and less than $\left(-\frac{3}{2}\right)^3 = -\frac{27}{8},$ so $\frac{a^3b^3+1}{a^3+b^3} < \frac{-\frac{27}{8}+1}{-\frac{3}{2}+1} = \frac{25}{11}.$

