Let $f(x) = |x + y| + |x - y|.$  Then
\[f(x) \le 4 \quad \text{if and only if} \quad -4 \le |x + y| + |x - y| \le 4.\]This is equivalent to
\[-4 \le |x + y| \le 4 \quad \text{and} \quad -4 \le |x - y| \le 4.\]The solutions to $|x + y| \le 4$ are given by $-4 \le x + y \le 4,$ or $-4 \le x \le 4$ and $-4 \le y \le 0.$  The solutions to $|x - y| \le 4$ are given by $-4 \le x - y \le 4,$ or $-4 \le x \le 0$ and $-4 \le y \le 4.$  The overlap of these regions is shown below.

