When using the distributive property for the first time, we add the product of $3$ and $(x+4)$ to the product of $3$ and $(x+5)$:

\begin{align*}
3(x+4)(x+5) &= 3(x+4) + 3(x+5)\\
&= 3x+12 + 3x+15
\end{align*}We use the distributive property again and combine like terms:

\begin{align*}
3x+12 + 3x+15 &= 3x+3x + 12+15\\
&= \boxed{6x+27}
\end{align*} The answer is: 6x+27

