Each of these diagonals creates two angles, one at each endpoint, so the total number of angles created by diagonals is $2(2 + 1) = 6$.  Each diagonal also creates two sides, one at each endpoint, so the total number of sides created by diagonals is $2(2 + 1) = 6$.  Since each diagonal creates six new elements (three each of sides and angles), and there are $\boxed{12}$ diagonals in all, we can find the number of diagonals by dividing the total number of sides and angles by 6 and taking twice that result. The answer is: 12

