The other two vertices must be $(x,3)$ and $(-4,y)$ for some integers $x$ and $y.$  The sides of the rectangle must be parallel to the sides of the coordinate plane, so the rectangle must have sides of length $|x + 4|$ and $|y - 3|.$  Thus, we have the inequalities
\[|x + 4| \ge 1, \quad |y - 3| \ge 1,\]which imply $x \le -3$ and $y \ge 2.$  Also, the diagonals of the rectangle must have equal length, so
\[[(x - (-4))^2 + (y - (-3))^2]^{1/2} = |x + 4|,\]which implies $x^2 - 8x + y^2 - 6y + 16 = 0.$  This equation represents a parabola, and the shaded region below is the region where $x \le -3$ and $y \ge 2.$

