Question: Let $\mathbf{a} = \begin{pmatrix} 7 \\ -4 \\ -4 \end{pmatrix}$ and $\mathbf{c} = \begin{pmatrix} -2 \\ -1 \\ 2 \end{pmatrix}.$  Find the vector $\mathbf{b}$ such that $\mathbf{a},$ $\mathbf{b},$ and $\mathbf{c}$ are collinear, and $\mathbf{b}$ bisects the angle between $\mathbf{a}$ and $\mathbf{c}.$

[asy]
unitsize(0.5 cm);

pair A, B, C, O;

A = (-2,5);
B = (1,3);
O = (0,0);
C = extension(O, reflect(O,B)*(A), A, B);

draw(O--A,Arrow(6));
draw(O--B,Arrow(6));
draw(O--C,Arrow(6));
draw(interp(A,C,-0.1)--interp(A,C,1.1),dashed);

label("$\mathbf{a}$", A, NE);
label("$\mathbf{b}$", B, NE);
label("$\mathbf{c}$", C, NE);
[/asy]
Answer:

output:
Let $\mathbf{b} = \begin{pmatrix} x \\ y \\ z \end{pmatrix}.$  Since $\mathbf{a},$ $\mathbf{b},$ and $\mathbf{c}$ are collinear, the vector $\mathbf{c} - \mathbf{a}$ is proportional to $\mathbf{b} - \mathbf{a}.$  Thus,
\[\frac{\mathbf{c} - \mathbf{a}}{\|\mathbf{c} - \mathbf{a}\|} = k \frac{\mathbf{b} - \mathbf{a}}{\|\mathbf{b} - \mathbf{a}\|}\]for some scalar $k.$  Then
\[\mathbf{b} - \mathbf{a} = k \|\mathbf{c} - \mathbf{a}\| \frac{\mathbf{c} - \mathbf{a}}{\|\mathbf{c} - \mathbf{a}\|} = k (\mathbf{c} - \mathbf{a}).\]Taking the dot product with $\mathbf{c} - \mathbf{a},$ we get
\[(\mathbf{b} - \mathbf{a}) \cdot (\mathbf{c} - \mathbf{a}) = k \|\mathbf{c} - \mathbf{a}\|^2.\]Since $\mathbf{c} \cdot \mathbf{a} = 7 - 4 - 4 = 5$ and $\mathbf{c} \cdot \mathbf{c} = 1 + 1 + 4 = 6,$
\begin{align*}
(\mathbf{b} - \mathbf{a}) \cdot (\mathbf{c} - \mathbf{a}) &= (\mathbf{b} \cdot \mathbf{c} - \mathbf{a} \cdot \mathbf{c}) - (\mathbf{b} \cdot \mathbf{a} - \mathbf{a} \cdot \mathbf{a}) \\
&= \mathbf{b} \cdot \mathbf{c} - \mathbf{a} \cdot \mathbf{c} - \mathbf{b} \cdot \mathbf{a} + \mathbf{a} \cdot \mathbf{a} \\
&= \mathbf{b} \cdot \mathbf{a} - \mathbf{a} \cdot \mathbf{a} \\
&= \mathbf{a} \cdot (\mathbf{b} - \mathbf{a}) \\
&= k \|\mathbf{c} - \mathbf{a}\|^2.
\end{align*}Hence,
\[\mathbf{a} \cdot (\mathbf{b} - \mathbf{a}) = k \|\mathbf{c} - \mathbf{a}\|^2.\]Since $\mathbf{a}$ is nonzero, we can divide both sides by $\|\mathbf{a}\|$ to get
\[\mathbf{a} \cdot \left( \frac{\mathbf{b} - \mathbf{a}}{\|\mathbf{a}\|} \right) = k \|\mathbf{c} - \mathbf{a}\|^2.\]This tells us that the vector $\frac{\mathbf{b} - \mathbf{a}}{\|\mathbf{a}\|}$ is proportional to $\mathbf{c} - \mathbf{a}.$

[asy]
unitsize(0.5 cm);

pair A, B, C, O;

A = (-2,5);
B = (1,3);
O = (0,0);
C = extension(O, reflect(O,B)*(A), A, B);

draw(O--A,Arrow(6));
draw(O--B,Arrow(6));
draw(O--C,Arrow(6));
draw(interp(A,C,-0.1)--interp(A,C,1.1),dashed);
draw(interp(A,B,-0.1)--interp(A,B,1.1),dashed);

label("$\mathbf{a}$", A, NE);
label("$\mathbf{b}$", B, NE);
label("$\mathbf{c}$", C, NE);
[/asy]

Since $\mathbf{a}$ and $\mathbf{c}$ are nonzero, the vectors $\frac{\mathbf{b} - \mathbf{a}}{\|\mathbf{a}\|}$ and $\frac{\mathbf{c} - \mathbf{a}}{\|\mathbf{a}\|}$ are proportional, which means that the plane containing $\mathbf{a},$ $\mathbf{b},$ and $\mathbf{c}$ is perpendicular to the plane containing $\mathbf{b} - \mathbf{a}$ and $\mathbf{c} - \mathbf{a}.$

[asy]
unitsize(0.5 cm);

pair A, B, C, O;

A = (-2,5);
B = (1,3);
O = (0,0);
C = extension(O, reflect(O,B)*(A), A, B);

draw(O--A,Arrow(6));
draw(O--B,Arrow(6));
draw(O--C,Arrow(6));
draw(interp(A,C,-0.1)--interp(A,C,1.1),dashed);
draw(interp(A,B,-0.1)--interp(A,B,1.1),dashed);
draw(interp(B,C,-0.1)--interp(B,C,1.1),dashed);

label("$\mathbf{a}$", A, NE);
label("$\mathbf{b}$", B, NE);
label("$\mathbf{c}$", C, NE);
[/asy]

This means that the plane containing $\mathbf{b} - \mathbf{a}$ and $\mathbf{c} - \mathbf{a}$ must pass through the origin.  In other words, $\mathbf{b} - \mathbf{a}$ and $\mathbf{c} - \mathbf{a}$ must be proportional to each other.  Hence,
\[\mathbf{b} - \mathbf{a} = k (\mathbf{c} - \mathbf{a}).\]Then $\mathbf{b} = k \mathbf{c} + (1 - k) \mathbf{a}.$  Since $\mathbf{a}$ and $\mathbf{c}$ are nonzero, we can divide both sides by $\mathbf{c} \cdot \mathbf{c}$ to get
\[\frac{\mathbf{b} \cdot \mathbf{c}}{\mathbf{c} \cdot \mathbf{c}} = k.\]Since $\mathbf{c} \cdot \mathbf{c} = 6,$
\[k = \frac{\mathbf{b} \cdot \mathbf{c}}{6}.\]Since $\mathbf{b}$ bisects the angle between $\mathbf{a}$ and $\mathbf{c},$ $\mathbf{b} \cdot \mathbf{c} = \frac{1}{2} \mathbf{a} \cdot \mathbf{c}.$  Hence,
\[k = \frac{\mathbf{a} \cdot \mathbf{c}}{12}.\]Therefore,
\[\mathbf{b} = \frac{\mathbf{a} \cdot \mathbf{c}}{12 \mathbf{c} \cdot \mathbf{c}} \mathbf{c} + \left( 1 - \frac{\mathbf{a} \cdot \mathbf{c}}{12 \mathbf{c} \cdot \mathbf{c}} \right) \mathbf{a} = \frac{\mathbf{a} \cdot \mathbf{c}}{12 \mathbf{c} \cdot \mathbf{c}} \mathbf{c} + \frac{11 \mathbf{a} \cdot \mathbf{a} - 12 \mathbf{a} \cdot \mathbf{c}}{12 \mathbf{c} \cdot \mathbf{c}} \mathbf{a}.\]We can compute that $\mathbf{a} \cdot \mathbf{c} = 22$ and $\mathbf{c} \cdot \mathbf{c} = 6,$ so
\[\mathbf{b} = \frac{22}{72} \begin{pmatrix} -2 \\ -1 \\ 2 \end{pmatrix} + \frac{49}{72} \begin{pmatrix} 7 \\ -4 \\ -4 \end{pmatrix} = \boxed{\begin{pmatrix} 11/6 \\ -7/6 \\ -11/6 \end{pmatrix}}.\] The answer is: \begin{pmatrix} 11/6 \\ -7/6 \\ -11/6 \end{pmatrix}

