Since $\angle ABC$ is inscribed in arc $BC$ and $\angle ABC=2\angle BAC$, we have $2\angle BAC=\frac{2\angle ABC}{3}$, so $\angle BAC=\frac{\angle ABC}{3}$.  Since $\angle ABC=\angle BAC+\angle BCA$, we have $\angle BCA=2\angle BAC=\frac{2\angle ABC}{3}$.  Therefore, arc $BC$ is equal to $\frac{2\angle ABC}{3}$ of the circumference of the larger circle.

The circumference of the larger circle is $2\pi\cdot 2=4\pi$, so the arc length of $BC$ is $\frac{4\pi\angle ABC}{3}$.  Since the radius of the smaller circle is 1, we have $\angle ABC=\frac{3}{4\pi}$.  Therefore, the area of $\triangle ABC$ is \[\frac{1}{2}\cdot \frac{4\pi\angle ABC}{3}=\boxed{\frac{2\pi}{3}}.\] The answer is: \frac{2\pi}{3}

