Question: Isosceles right triangle $ABC$ encloses a semicircle of area $2\pi$. The circle has its center $O$ on hypotenuse $\overline{AB}$ and is tangent to sides $\overline{AC}$ and $\overline{BC}$. What is the area of triangle $ABC$? [asy]
pair a=(4,4), b=(0,0), c=(0,4), d=(4,0), o=(2,2);
draw(circle(o, 2));
clip(a--b--c--cycle);
draw(a--b--c--cycle);
dot(o);
label("$C$", c, NW);
label("$A$", a, NE);
label("$B$", b, SW);
[/asy]
Answer:

output:
Let $O$ be the center of the semicircle, and let $r$ be the radius of the semicircle. Since the semicircle is tangent to both $\overline{AC}$ and $\overline{BC}$, $O$ lies on $\overline{AC}$ and $\overline{BC}$. Let $x = AC = BC$.

[asy]
pair a=(4,4), b=(0,0), c=(0,4), d=(4,0), o=(2,2);
draw(circle(o, 2));
clip(a--b--c--cycle);
draw(a--b--c--cycle);
dot(o);
label("$C$", c, NW);
label("$A$", a, NE);
label("$B$", b, SW);
label("$O$", o, SE);
label("$r$", (o + 0.5, o + 0.5), NE);
label("$x$", (a + c)/2, N);
[/asy]

Then $AB = x + r$, $AC = x$, and $BC = x$, so by the Pythagorean Theorem, \[
r^2 + x^2 = x^2 + (x+r)^2 \Rightarrow r^2 = 2x^2 + 2rx.
\]Since $r$ and $x$ are positive, we can divide both sides by $2x$, to get $r = x + \frac{r}{x}$.  Then $x = r - \frac{r}{x} = \frac{rx}{x+r}$.

Since $x = AC = BC$, triangle $ABC$ is isosceles, and $\angle ABC = 45^\circ$.  Therefore, the area of triangle $ABC$ is \[
\frac{1}{2} \cdot AC \cdot BC \cdot \sin \angle ABC = \frac{1}{2} \cdot x^2 \cdot \sin 45^\circ = \frac{x^2 \sqrt{2}}{4}.
\]Substituting $x = \frac{rx}{x+r}$ gives \[
\frac{x^2 \sqrt{2}}{4} = \frac{r^2 x^2}{4(x+r)^2} \cdot \sqrt{2} = \frac{r^2 x^2 \sqrt{2}}{8(x+r)^2}.
\]Since $x$ and $r$ are positive, we can cancel the factors of $x$ and $r$ to get \[
\frac{x^2 \sqrt{2}}{4} = \frac{r^2 \sqrt{2}}{8(x+r)^2}.
\]Then $r^2 = \frac{x^2 (x+r)^2}{2}$, so \[
2\pi r = \frac{x^3 (x+r)}{2\sqrt{2}} \Rightarrow 2\pi r^2 = \frac{x^3 (x+r)}{2\sqrt{2}} \cdot r = \frac{x^4 (x+r)}{2\sqrt{2}}.
\]Since $x$ and $r$ are positive, we can cancel the factors of $x$ and $r$ to get \[
2\pi r^2 = \frac{x^4 (x+r)}{2\sqrt{2}} \Rightarrow 2\pi = \frac{x^3 (x+r)}{2\sqrt{2}}.
\]Then $x^3 (x+r) = 4\sqrt{2}\pi$, so \[
x^3 + x^2 r = 4\sqrt{2}\pi \Rightarrow x^3 + x^2 r - 4\sqrt{2}\pi = 0.
\]Since $x$ and $r$ are positive, we can factor to get \[
(x-2\sqrt{2})(x^2 + 2x\sqrt{2} + 4\pi) = 0.
\]Since $x$ is positive, we can cancel the factors of $x$ to get \[
x^2 + 2x\sqrt{2} + 4\pi = 0 \Rightarrow x^2 + 2x\sqrt{2} + 4 = 0.
\]Since $x$ is positive, we can take the square root of both sides to get \[
x + \sqrt{2}x = \pm 2 \sqrt{2} \Rightarrow x = \pm 2.
\]Since $x$ is positive, we have $x = 2$.  Then $r = x - \frac{r}{x} = \frac{2}{3}$.  Therefore, the area of triangle $ABC$ is \[
\frac{x^2 \sqrt{2}}{4} = \frac{2^2 \sqrt{2}}{4} = \boxed{\sqrt{2}}.
\] The answer is: \sqrt{2}

