\[\sin (90^\circ - \theta) = \sin \theta \cos 90^\circ - \cos \theta \sin 90^\circ = \sin \theta.\]Then $\sin \theta = \frac{3}{5},$ so
\[\cos \theta = \frac{4}{5}.\]Then
