Let the center of the circle be $(a,b).$  Then the equation of the circle is
\[(x - a)^2 + (y - b)^2 = r^2.\]Setting $y = x^2$ in this equation, we get
\[(x - a)^2 + (x^2 - b)^2 = r^2.\]Completing the square in $x,$ we get
\[(x - a)^2 + (x^2 - b)^2 = (x - a)^2 + b^2 + r^2.\]Then
\[(x^2 - b)^2 = b^2 + r^2.\]Since $x^2 \ge 0,$ $b^2 \le b^2 + r^2,$ so $r^2 \ge 0,$ which means $r \ge 0.$

