Since the circle is tangent to the parabola at $A$ and $B,$ the line segments from $O$ to $A$ and $O$ to $B$ are both tangents to the circle.  Hence, $OA = OB = r.$

Since the parabola is symmetric about the $y$-axis, the center of the circle is on the $y$-axis, so $a = 0.$  Then the equation of the circle becomes
\[x^2 + (y - b)^2 = r^2.\]Setting $y = x^2$ in this equation, we get
\[x^2 + (x^2 - b)^2 = r^2.\]Then $2x^2 = r^2,$ so $x^2 = \frac{1}{2} r^2.$  Hence,
\[r = \frac{1}{\sqrt{2}} \cdot \sqrt{b^2 + \frac{1}{2} r^2}.\]Then $b^2 + \frac{1}{2} r^2 \ge 0,$ so $r \le \sqrt{2}.$

Equality occurs when $b = \frac{1}{\sqrt{2}}$ and $r = \sqrt{2},$ so the maximum value of $r$ is $\boxed{\sqrt{2}}.$ The answer is: \sqrt{2}

