Thus, the line through $A$ and $B$ is parameterized by
\[\begin{pmatrix} 6 \\ -7 \\ 7 \end{pmatrix} + t \begin{pmatrix} 13 \\ 17 \\ -12 \end{pmatrix} = \begin{pmatrix} 6 + 13t \\ -7 + 17t \\ 7 - 12t \end{pmatrix}.\]If this point is also on line $CD,$ then its direction vector must be a scalar multiple of $\begin{pmatrix} 2 \\ -3 \\ 6 \end{pmatrix}.$  Thus, we must have
\[\begin{pmatrix} 13 \\ 17 \\ -12 \end{pmatrix} = s \begin{pmatrix} 2 \\ -3 \\ 6 \end{pmatrix} = \begin{pmatrix} 2s \\ -3s \\ 6s \end{pmatrix}.\]Then $13 = 2s,$ $-17 = -3s,$ and $-12 = 6s.$  Solving, we find $s = -2.$  Hence, the intersection point is $\boxed{(10,-11,1)}.$ The answer is: (10,-11,1)

