We have two variables, $x$ and $y$, representing the lengths of the two sides that are not yet fenced in. We know that $x+y+360=360$, so $x+y=0$. We want to maximize $xy$, subject to the constraint $x+y=0$. We can solve this problem using the method of Lagrange multipliers.

We define the Lagrangian $\mathcal{L}(x,y,\lambda)=xy-\lambda(x+y)$. We want to find the values of $x$ and $y$ that maximize $\mathcal{L}$, subject to the constraint $x+y=0$. We know that at a maximum, the partial derivatives of $\mathcal{L}$ with respect to $x$ and $y$ must be equal to zero:
\[\frac{\partial \mathcal{L}}{\partial x}=y-\lambda=0\]
\[\frac{\partial \mathcal{L}}{\partial y}=x-\lambda=0\]
From these equations, we have $y=\lambda$ and $x=\lambda$. Substituting these into the equation $x+y=0$, we have $\lambda+\lambda=0$, so $\lambda=0$. Thus, the maximum value of $xy$ is $0\cdot0=\boxed{0}$. The answer is: 0

