Let $n = \lfloor x \rfloor$ and $m = \lfloor y \rfloor.$  Then
\[100 \{x\} \ge n + m,\]so $100 \{x\} - n - m \ge 0.$  In other words,
\[100 \{x\} - n - m = \left\lfloor 100 \{x\} \right\rfloor - n - m \ge 0,\]so $\left\lfloor 100 \{x\} \right\rfloor \ge n + m.$

Since $n + m$ is a nonnegative integer, and $\left\lfloor 100 \{x\} \right\rfloor$ is a multiple of 100, the smallest value of $\left\lfloor 100 \{x\} \right\rfloor$ that is greater than $n + m$ is $100(n + 1).$  Hence,
\[100 \{x\} \ge 100(n + 1) \ge n + m + 1.\]We can write this as
\[100 \{x\} \ge n + m + \frac{1}{100}.\]Since $n + m$ is an integer, the inequality above is satisfied only when $100 \{x\} \ge n + m + 1.$  In other words,
\[100 \{x\} = n + m + 1.\]Then $100 \{x\} - n - m - 1 \le 0,$ so
\[\left\lfloor 100 \{x\} \right\rfloor - n - m - 1 \le 0,\]which means $\left\lfloor 100 \{x\} \right\rfloor \le n + m + 1.$

We have shown that
\[n + m + 1 \le \left\lfloor 100 \{x\} \right\rfloor \le n + m + 2.\]Since $\left\lfloor 100 \{x\} \right\rfloor$ is an integer, it must be equal to $n + m + 1.$  Then
\[100 \{x\} = n + m + 1 = \left\lfloor 100 \{x\} \right\rfloor,\]so $\{x\} = \frac{1}{100}.$  In other words, $x$ must be of the form $n + \frac{1}{100},$ where $n$ is an integer.

The region described is then
