The hyperbola $\frac{x^2}{4} - \frac{y^2}{9} = 1$ has asymptotes $y = \pm \frac{x \sqrt{3}}{3}.$ Thus, we want the hyperbola $\frac{y^2}{18} - \frac{x^2}{N} = 1$ to have asymptotes $y = \pm \frac{x \sqrt{3}}{3}.$ This means we want the slope of the asymptotes to be $\pm \frac{\sqrt{3}}{3}.$

The slope of the asymptotes is $\frac{-\frac{4}{9}}{\frac{x}{4}} = -\frac{4}{3x}.$ Thus, we want \[-\frac{4}{3x} = \pm \frac{\sqrt{3}}{3}.\]This gives us $x = \pm \frac{4}{\sqrt{3}}.$ Thus, we want the hyperbola $\frac{y^2}{18} - \frac{x^2}{N} = 1$ to have vertices at $(\pm \frac{4}{\sqrt{3}}, 0).$

The distance from the vertices to the center of the hyperbola is $\frac{4}{\sqrt{3}}.$ Thus, the center of the hyperbola is $(\pm \frac{4}{\sqrt{3}}, 0).$ This means the center of the hyperbola is at the origin, so the equation of the hyperbola is of the form \[\frac{(x - a)^2}{a^2} - \frac{(y - b)^2}{b^2} = 1.\]We know that $a = \frac{4}{\sqrt{3}}.$ Also, the hyperbola has foci at $(\pm 2, 0),$ so $b = 2.$ Thus, the equation of the hyperbola is \[\frac{(x - \frac{4}{\sqrt{3}})^2}{\left( \frac{4}{\sqrt{3}} \right)^2} - \frac{(y - 2)^2}{2^2} = 1.\]This gives us $N = \left( \frac{4}{\sqrt{3}} \right)^2 = \boxed{\frac{16}{3}}.$ The answer is: \frac{16}{3}

