Since $G$ is the midpoint of $PM$, we have $[G_1 G_2 G_3] = 2[G M P]$.  By Heron's formula, the area of triangle $ABC$ is
\[[ABC] = \sqrt{2} \cdot s \cdot r,\]where $s = \frac{AC \cdot BC \cdot AB}{4}$ is the semiperimeter and $r = \frac{AB \cdot AC \cdot BC}{4 \sqrt{2}}$ is the inradius.  Hence, $r = \frac{s}{\sqrt{2}} = \frac{3}{\sqrt{2}}$.

Since $AM = BM = r$, we have $[G M P] = \frac{1}{2} \cdot r \cdot PM = \frac{1}{2} \cdot \frac{3}{\sqrt{2}} \cdot (P M) = \frac{3}{2 \sqrt{2}} \cdot PM$.  Therefore,
\[[G_1 G_2 G_3] = 2[G M P] = \frac{3}{2 \sqrt{2}} \cdot PM.\]Since $P$ is inside triangle $ABC$, $PM < AB = 4$, so
\[[G_1 G_2 G_3] < \frac{3}{2 \sqrt{2}} \cdot 4 = \boxed{6}.\] The answer is: 6

